import VideoCard from "../../components/VideoCard/VideoCard";
import Categories from "../../components/Categories/Categories";
import "./Home.scss";

const Home = () => {
    return (
        <div>
            <Categories />
            <div className="banner">
                {/* <img src="https://i.ibb.co/Vm9bYSF/banner.jpg" alt="banner" /> */}
                <img
                    src="https://images.unsplash.com/photo-1510414842594-a61c69b5ae57?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"
                    alt="banner3"
                />
            </div>
            <div className="videos">
                {[...new Array(20)].map((item, index) => (
                    <div className="videos__wrap" key={index}>
                        {" "}
                        <VideoCard key={index} />
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Home;
